import React from 'react';
import './Node.css';

const Node = ({ centX, centY }) => {
	// add the 'px' and convert cx, cy to strings
	var cx_str = centX + 'px';
	var cy_str = centY + 'px';

	// overwrite width, height and border-radius styles
	var circStyles = {
		marginTop: cy_str,
		marginLeft: cx_str,
    	width: '75px',
    	height: '75px',
		borderRadius: '50%',
		background: 'grey',
	};


	return (
		<div style = {circStyles}>			
		</div>
	);
}

export default Node;
